import styled from "styled-components";

export const SSection = styled.section`
  width: 100%;
  padding: 125px 0;
  display: block;
  overflow: hidden;
  background: 0 0;
  background-color: #0f95b0;
`;

export const SDetail = styled.div`
  width: 100%;
  height: auto;
  margin: 0 auto;
  padding: 0 16px 0 16px;
  background-color: #fff;
  font-size: 1.2em;
  font-weight: 150;
  text-align: center;
  z-index: 8;
  display: inline-block;
  position: absolute;
`;
